import React, {Component} from 'react';
import { connect } from 'react-redux';
import { fetchCoins } from '../actions/coinActions';
import { Table, TableBody, TableRow, TableCell} from '@material-ui/core';
import SimpleTable from './Table';

class Coins extends Component {
   componentDidMount() {
       console.log('before did mount');
       this.props.fetchCoins();
   }
   render() {
       let coinItems = '';
       console.log(this.props.coins.data);
       if (this.props.coins.data) {
           // coinItems = this.props.coins.data.map( coin => (
               return (<SimpleTable
                   data={this.props.coins.data}
               />
               )
           // ));
       } else {
           coinItems = 'Loading';
       }
       console.log(this.props);
       return (
           <div>
               <h1>All Coins</h1>
               {coinItems}
           </div>
       );
   }
}
const mapStateToProps = state => ({
   coins: state.coins.items
})
export default connect(mapStateToProps, { fetchCoins } )(Coins);
